  true,\n\t\"url\": null,\n\t\"notes\": \"The Making Home Affordable Program Performance
  Report, which provides detailed metrics on the Making Home Affordable (MHA) Program
  is changing from a monthly report to a quarterly release. The last monthly report
  was for May 2014. Each quarterly report will contain the detailed assessments of
  the performance of servicers participating in the Making Home Affordable program.
  Treasury provides information about servicer performance through two types of data:
  rnu2022Compliance data, which reflects servicer compliance with specific MHA guidelines;
  andrnu2022Program results data, which reflects how timely and effectively servicers
  assist eligible homeowners and report program activity.\",\n\t\"license_title\":
